import React from "react";
import { Drawer } from "@mui/material";

const drawerStyle = {
    left: 20,
    height: "95%",
}

const InfoDrawer=({open, setOpen})=>{

    const toggleDrawer=()=>{
        setOpen(false);
    }

    return (
        <div>
            <Drawer
      open={open}
      onClose={toggleDrawer}
      PaperProps={{sx: drawerStyle}}
      style={{zIndex: 1500}}
    >
        HELLO
    </Drawer>
        </div>
    );
}

export default InfoDrawer;
